import React, { useState, useEffect, Component } from 'react';
import './App.css';
import {Button, Navbar} from './components/common';
import {BrowserRouter as Router, Link, Switch, Route} from 'react-router-dom';
import firebase from 'firebase'
import StyledFirebaseAuth from "react-firebaseui/StyledFirebaseAuth"

//Pages
import MainPage from './pages/index';
import createMaster from './pages/createMaster';

firebase.initializeApp({
  apiKey:"AIzaSyCgBgYQYByo-4RHmLohvtBb33UFknX8SF0",
  authDomain:"third-wharf-305714.firebaseapp.com"
})

class App extends Component {

  state = { isSignedIn: false }
  uiConfig = {
    signInFlow: "popup",
    signInOptions: [
      firebase.auth.GoogleAuthProvider.PROVIDER_ID,
    ],
    callbacks: {
      signInSuccess: () => false
    }
  }
  
  componentDidMount(){
    firebase.auth().onAuthStateChanged(user=>{
      this.setState({isSignedIn:!!user})
    })
  }

  render(){
    return (  

      <div className="App">
             <StyledFirebaseAuth 
              uiConfig={this.uiConfig}/>
      </div>

      /*
      <Router>
        <div className="MainPage">
        <Navbar/>
        <Route exact path='/' component={MainPage}/>
  
        firebaseAuth={firebase.auth()}/>
        </div>
        <Switch>
      <div className="masterx">
          <Route exact path='/createMaster' component={createMaster}/>
          </div>
        </Switch>
    
      </Router>
      */
    );
  }
}

export default App;
